import React from 'react';
import './Product.css';

const Product = (props) => {
    const {name, img, seller, stock}= props.product
    return (
        <div className="product">
            <div>
                <img src={img} alt="" />
            </div>
            <div>
            <h5>
                {name}</h5>
            </div>
        </div>
    );
};

export default Product;
